import React from "react";

const Footer = ()=>{
    return(
        <>
        <section>
        <div className="my-1 bg-light">
            <div className="container">
                <div className="row">
                    <div className="col-12 mx-auto">
                        <footer>
                        <p className="text-center"> ©️2023 Ali Murtaza. All rights reserrved | Terms & Condition.</p>
                        </footer>
                    </div>
                </div>
            </div>
        </div>
        </section>
        </>
    );
}

export default Footer;
